import React from "react";
import Dropdown from './Dropdown/Dropdown'
import { BrowserRouter as Router } from "react-router-dom";
import './menu.css'
import Fresh from './sub-content/Fresh'

function Menu() {
	return (
		<Router>
		<body>	
			<div className="fixedNav"><Dropdown/></div>
			<div className="fnBar"></div>
			<Fresh></Fresh>

		</body>
		</Router>
	);
}
export default Menu;
